import React from 'react';
import {Link} from 'react-router-dom';
import '../styles/Navbar.css'
import ReorderIcon from "@material-ui/icons/Reorder";

function Navbar() {
return (
    <div className="navbar">
        <div className='toggleButton'>
            <button>
                <RecorderIcon />
            </button>
        </div>
    </div>
);
}

export default Navbar;
